import React from 'react'
import Tasks from './Tasks'

export default function TodoListSidebar(props) {
    const tasksList = props.listTasks;
    return (
        <div>
            {tasksList.map((e) => <button>{e.title}</button>)}
            <Tasks tasks={tasksList[0].taskList}/>
        </div>
    )
}
